def read_and_create_sequences_fromJSON(filename):

    f = open(filename, "r")
    d = json.load(f)

    if "Kalign" in filename:
        tool = "Kalign"
    elif "Clustal" in filename:
        tool = "Clustal"
    else:
        tool = "Muscle"

    outputList = []

    for sequence in d["seqs"]:
        if "Italy" in sequence["name"]:
            country = "Italy"
        elif "Austria" in sequence["name"]:
            country = "Austria"
        else:
            country = "Iceland"
        id = sequence["name"][sequence["name"].find("|")+1:]
        id = id[:id.find("|")]
        if "/" in id:
            id = id[:id.find("/")]
        seq = sequence["seq"].upper()
        if id != "NC_045512":
            outputList.append({"name": country + "_" + id, "seq": seq})
        else:
            ref = seq

    return outputList, ref, tool


def show_differences(begin, i, ref, seq, method, seqName, listDiff, tool):

    dictSeq = {"nameSeq": seqName,
               "method": method,
               "begin": begin + 1,
               "end": i,
               "ref": ref[begin:i],
               "seq": seq[begin:i],
               "tool": tool}

    listDiff.append(dictSeq)

    return False


def check_equal_record(record1, record2):
    return record1["begin"] == record2["begin"] and record1["end"] == record2["end"] and \
           record1["type"] == record2["type"] and record1["refSubstring"] == record2["refSubstring"] and \
           record1["seqSubstring"] == record2["seqSubstring"]


def are_symbols_equal(x, y):
    iupac_dict = {"A": ["R", "W", "M", "D", "H", "V", "N"],
                  "C": ["Y", "S", "M", "B", "H", "V", "N"],
                  "G": ["R", "S", "K", "B", "D", "V", "N"],
                  "T": ["Y", "W", "K", "B", "D", "H", "N"]}

    return x == y or (x != '-' and y in iupac_dict[x])


def get_amino_acid(triplet, check_begin):
    amino_acid_dict = {"START": ["ATG", "GTG"],
                       "A": ["GCT", "GCC", "GCA", "GCG"],
                       "R": ["CGT", "CGC", "CGA", "CGG", "AGA", "AGG"],
                       "N": ["AAT", "AAC"],
                       "D": ["GAT", "GAC"],
                       "C": ["TGT", "TGC"],
                       "Q": ["CAA", "CAG"],
                       "E": ["GAA", "GAG"],
                       "G": ["GGT", "GGC", "GGA", "GGG"],
                       "H": ["CAT", "CAC"],
                       "I": ["ATT", "ATC", "ATA"],
                       "L": ["TTA", "TTG", "CTT", "CTC", "CTA", "CTG"],
                       "K": ["AAA", "AAG"],
                       "M": ["ATG"],
                       "F": ["TTT", "TTC"],
                       "P": ["CCT", "CCC", "CCA", "CCG"],
                       "S": ["TCT", "TCC", "TCA", "TCG", "AGT", "AGC"],
                       "T": ["ACT", "ACC", "ACA", "ACG"],
                       "W": ["TGG"],
                       "Y": ["TAT", "TAC"],
                       "V": ["GTT", "GTC", "GTA", "GTG"],
                       "STOP": ["TAG", "TGA", "TAA"]}

    for key in amino_acid_dict.keys():
        if triplet in amino_acid_dict[key]:
            if key == "START" and not check_begin:
                continue
            return key


def project_1():

    finalDict = {}

    for filename in FILENAME:

        listSequences, ref, tool = read_and_create_sequences_fromJSON(filename)

        insert = False
        edit = False
        delete = False
        begin = 0
        end = 0
        listDiff = []

        for sequence in listSequences:
            seq = sequence["seq"]
            name = sequence["name"]
            for i in range(len(ref)):
                if are_symbols_equal(ref[i], seq[i]):
                    if delete:
                        delete = show_differences(begin, i, ref, seq, "Delete", name, listDiff, tool)
                    elif edit:
                        edit = show_differences(begin, i, ref, seq, "Edit", name, listDiff, tool)
                    elif insert:
                        insert = show_differences(begin, i, ref, seq, "Insert", name, listDiff, tool)
                    continue
                elif ref[i] == "-":
                    if delete:
                        delete = show_differences(begin, i, ref, seq, "Delete", name, listDiff, tool)
                    elif edit:
                        edit = show_differences(begin, i, ref, seq, "Edit", name, listDiff, tool)
                    if not insert:
                        insert = True
                        begin = i
                elif seq[i] == "-":
                    if edit:
                        edit = show_differences(begin, i, ref, seq, "Edit", name, listDiff, tool)
                    elif insert:
                        insert = show_differences(begin, i, ref, seq, "Insert", name, listDiff, tool)
                    if not delete:
                        delete = True
                        begin = i
                else:
                    if delete:
                        delete = show_differences(begin, i, ref, seq, "Delete", name, listDiff, tool)
                    elif insert:
                        insert = show_differences(begin, i, ref, seq, "Insert", name, listDiff, tool)
                    if not edit:
                        edit = True
                        begin = i

            if delete:
                delete = show_differences(begin, len(ref), ref, seq, "Delete", name, listDiff, tool)
            elif edit:
                edit = show_differences(begin, len(ref), ref, seq, "Edit", name, listDiff, tool)
            elif insert:
                insert = show_differences(begin, len(ref), ref, seq, "Insert", name, listDiff, tool)

        outputDict = {}
        for element in listDiff:
            nameSeq = element["nameSeq"]
            method = element["method"]
            begin = element["begin"]
            end = element["end"]
            ref = element["ref"]
            seq = element["seq"]
            key = "'begin': %d, 'end': %d, 'type': '%s', 'refSubstring': '%s', 'seqSubstring': '%s'," % \
                  (begin, end, method, ref, seq)
            if key not in outputDict.keys():
                outputDict[key] = [nameSeq]
            else:
                outputDict[key].append(nameSeq)

        outputList = []
        for key in outputDict.keys():
            outputList.append(literal_eval("{" + key + " 'sequences': " + str(outputDict[key]) + "}"))

        finalDict[tool] = outputList

    finalList = []
    for element in finalDict["Clustal"]:
        element["tool"] = ["Clustal"]
        finalList.append(element)

    for element in finalDict["Muscle"]:
        found = False
        for elementAlreadyAdded in finalList:
            if check_equal_record(element, elementAlreadyAdded):
                elementAlreadyAdded["tool"].append("Muscle")
                found = True
                break
        if not found:
            element["tool"] = ["Muscle"]
            finalList.append(element)

    for element in finalDict["Kalign"]:
        found = False
        for elementAlreadyAdded in finalList:
            if check_equal_record(element, elementAlreadyAdded):
                elementAlreadyAdded["tool"].append("Kalign")
                found = True
                break
        if not found:
            element["tool"] = ["Kalign"]
            finalList.append(element)


    # ordino la lista finale
    finalList = sorted(finalList, key=lambda i: (i['begin'], i['end'], i['type']))


    # inserisco l'id e aggiungo l'informazione sul gene modificato nel reference sequence
    i = 1
    for element in finalList:
    	element["id"] = i
    	i += 1
    	for gene in GENES:
            if element["begin"] >= gene["begin"] and element["end"] <= gene["end"]:
                element["gene"] = gene
                break



    # salvo i risultati su un file .json
    output = open("output.json", "w")
    output.write("[")
    for i in range(len(finalList) - 1):
        output.write(str(finalList[i]) + ",\n")
    output.write(str(finalList[len(finalList) - 1]) + "]")
    output.close()


